def on_one_line(Points):
    n = len(Points)
    s = set([])
    for i in range(1,n):
        x,y = Points[i][0] - Points[0][0],Points[i][1] - Points[0][1]
        g = gcd(x,y)
        x //= g
        y //= g
        if (x < 0):
            x *= -1;y *= -1
        if (x == 0):
            y = abs(y)
        s.add((x,y))
    return len(s) == 1

