    g = gcd(p,q)
    p //= g;q //= g
    if (p < 0):p *= -1;q *= -1
    elif (p == 0):q = abs(q)

    not_same = []
    for i in range(2,n):
        x,y = Ps[i][0] - Ps[0][0],Ps[i][1] - Ps[0][1]
        x,y = x//gcd(x,y),y//gcd(x,y)
        if (x < 0):x *= -1;y *= -1
