def check(mid):
    mask = (1<<m)-1
    s = set()
    d = dict()
    for i in range(n):
        state = 0
        for j in range(m):
            if a[i][j] >= mid:
                state += 1<<j

        if state in s:
            continue
        s.add(state)
        k = state
        while k>=0:

            k &= state
            d[k] = i
            k -= 1
        need = mask^state

        if need in d:
            q1, q2 = d[need], i
            if q1 > q2:
                q1, q2 = q2, q1
            return True, (q1, q2)

    return False, (-1, -1)

