def strtonum(b):
    par=len(b)
    result=0
    for i in range(1,par):
        result+=(26**i)
    par=len(b)-1
    for elem in b:
        if par!=0:
             result+=((ord(elem)-ord("A"))*((26)**par))
        else:
            result += ((ord(elem) - ord("A"))+1)

        if par==0:
            break
        par -= 1
    return result

