def check(n,mid,path,cost,num):
    ans,poi,visi = [],[0]*n,[0]*n
    for i in range(n):
        if visi[i]:
            continue
        visi[i],st,st1 = 2,[i],[]
        while len(st):
            x,y = st[-1],path[st[-1]]
            if poi[x] == len(y):
                visi[x] = 1
                st1.append(st.pop())
            else:
                i,j = y[poi[x]],cost[st[-1]][poi[x]]
                poi[x] += 1
                if j <= mid:
                    continue
                if visi[i] == 2:
                    return -1
                if not visi[i]:
                    st.append(i)
                    visi[i] = 2
        ans += st1
    start = [0]*n
    for ind,i in enumerate(reversed(ans)):
        start[i] = ind
    poi,visi,fin = [0]*n,[0]*n,[]
    for i in range(n):
        if visi[i]:
            continue
        visi[i],st = 1,[i]
        while len(st):
            x,y = st[-1],path[st[-1]]
            if poi[x] == len(y):
                st.pop()
            else:
                i,j,k = y[poi[x]],cost[st[-1]][poi[x]],num[st[-1]][poi[x]]
                poi[x] += 1
                visi[i] = 1
                st.append(i)
                if start[i] < start[x] and j <= mid:
                    fin.append(k)
    return fin

